import React from "react";
import { FirstName, LastName } from "../App";
const CombinedContextConsumer = ({ children }) => (
  <FirstName.Consumer>
    {(fname) => {
      return (
        <LastName.Consumer>
          {(lname) => {
            return (
              <h1>
                My name is {fname} {lname}
              </h1>
            );
          }}
        </LastName.Consumer>
      );
    }}
  </FirstName.Consumer>
);
const ComC = () => {
  return (
    <>
      <CombinedContextConsumer>
      {(fname,lname) => {
            return (
              <h1>
                My name is {fname} {lname}
              </h1>
            );
          }}
      </CombinedContextConsumer>
    </>
  );
};
export default ComC;
